const Container = styled.div``;

const initalState = {
  scrolled: false
};

function HomePage() {
  const [store, reducer] = useReducer(Reducer.HomePage, initalState);

  return (
    <Container>
      <Nav show={store.scrolled} />
    </Container>
  );
}

export default HomePage;
